import React from 'react'
import Navbar from './Nav/Navbar'
import '../node_modules/bootstrap/dist/css/bootstrap.min.css'
import HeroSection from './HeroSec/HeroSection'
import Cards from './Cards/Cards'

function Home() {
  return (
    <>
    <Navbar />
    <HeroSection />
    <Cards />
    </>
  )
}

export default Home;
